import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import {Typography, Box} from '@material-ui/core';
import Navbar from '../navbar/navbar'; 
import RecipeReviewCard from './cards/cards'

const useStyles = makeStyles(theme => ({
    mainContainer: {
        background: "#34495e",
        color: "#ecf0f1",
        textAlign: "center",
        height: '100vh'
    },
    mainHeader: {
        paddingTop: '2rem',
        paddingBottom: '1rem',
        color: "#1abc9c",
        fontSize: '2rem',
        fontWeight: 'bold'
    },
    subHeader: {
        fontSize: '2rem',
        fontWeight: 'light',
        color: "#2ecc71"
    },
    cards: {
        marginLeft: '1rem'
    }
}))
const Projects = () => {
    const classes = useStyles();
    return (   
        <> 
        <Navbar/>
        <Box component="header" className ={classes.mainContainer}>
            <Typography className={classes.mainHeader}>Past Projects</Typography>
            <Box component ="div">
                <Typography className={classes.subHeader}>Web Development</Typography>
                <RecipeReviewCard className={classes.cards}/>
            </Box>
        </Box>
        </>
        );
  }

  export default Projects;
